import { Nav } from "react-bootstrap"
import { NavLink } from "react-router-dom";

function NavBar(){
    return(
        <div className="navbar">
            <ul>
                <li><NavLink exac to="/">Home</NavLink></li>
                <li><NavLink exac to="/pontuacao">pontuacao</NavLink></li>
            </ul>    
        </div>
    )
}

export default NavBar;
